def convert_to_nested_dict(lists):
    if not lists:
        return {}
    result = {}
    for item in lists[0]:
        result[item] = {}
    for lst in lists[1:]:
        for i, key in enumerate(lst):
            if i < len(lists[0]):
                result[key] = {}
    return result

